import java.io.*;
import java.util.*;
class  Main {
    static Scanner sc = new Scanner(System.in);
    static StringBuilder sb = new StringBuilder();
    public static void main(String [] args){
            int n = sc.nextInt();
            int m = sc.nextInt();
            int [] a = new int[n];
            int [] b  = new int[m];
            for(int i =0; i < a.length;i++){
                a[i] = sc.nextInt();
            }
            for(int i = 0 ; i < b.length;i++){
                b[i] =sc.nextInt();
            }
            Arrays.sort(a);
            Arrays.sort(b);
            int i = 0 ;
            int j = 0;
            int count = 0;
            while(i < a.length && j < b.length){
                double temp = ((double) b[j]) / ((double) a[i]);
                if(temp <= 3 && temp >=2){
                    count++;
                    j++;
                    i++;
                }else if(temp < 2){
                   j++;
                }else if(temp > 3){
                    i++;
                }
            }
            System.out.println(count);

    }
}
